 digits, and store each bit as a different element in a list. The &quot;endianness&quot; doesn&apos;t matter -- that is, the ones bit in the binary representation can be in list element 1 or list element D.&#xD;REQUIRES: D be at least as big as the number of digits in the binary representation of the number&#xD;E.g., (13)-&gt;binary-list-padded-to(5)digits → [1,0,1,1,0] or [0,1,1,0,1]&#xD;E.g., (13)-&gt;binary-list-padded-to(4)digits → [1,0,1,1] or [1,1,0,1]</comment></custom-block></script><script x=\"15\" y=\"566.9999999999999\"><custom-block s=\"Binary List Mask %l with %l\"><l/><l/><comment w=\"342.49999999999994\" collapsed=\"false\">2c) Binary List Mask is just like a number mask but with a binary list and a regular number list. A &quot;mask&quot; is a way to zero-out the numbers where there&apos;s a 0, and keep the numbers where there&apos;s a 1. The term used in computer architecture and graphic design (which often allows the mask to have numbers other than 0 and 1, for semi-transparent pixels).&#xD;REQUIRES: the two lists be the same length, the first contain only 1s and 0s, and the second contain only numbers.&#xD;E.g., Binary-List-Mask([1,0,1])with([3,4,5]) → [3,0,5]</comment></custom-block></script><script x=\"15\" y=\"700.4999999999999\"><custom-block s=\"Subset Sum Solution %l\"><l/><comment w=\"362.4999999999999\" collapsed=\"false\">2d) Solve the subset sum problem. That is, given a list of numbers, return a subset of those numbers that add to zero. (if none, return an empty list. If there is more than one subset, return any of them.)&#xD;E.g., Subset-Sum-Solution([-2,-3,15,14,7,-10]) → [-2,-3,15,-10]&#xD;E.g., Subset-Sum-Solution([-2,-3,16,14,7,-10]) → []&#xD;E.g., Subset-Sum-Solution([-2,-3,0,14,7,-10]) → [0]&#xD;</comment></custom-block></script></scripts></sprite></sprites></stage><hidden></hidden><headers></headers><code></code><blocks><block-definition s=\"label %&apos;text&apos; of size %&apos;size&apos;\" type=\"command\" category=\"pen\"><comment x=\"0\" y=\"0\" w=\"90\" collapsed=\"false\">LABEL will stamp text on the stage at the given font size. The direction of the text is the direction the sprite is facing, and color will match the pen color.</comment><header></header><code></code><inputs><input type=\"%txt\">Hello!</input><input type=\"%n\">12</input></inputs><script><block s=\"doRun\"><block s=\"reportJSFunction\"><list><l>text</l><l>size</l></list><l>var stage = this.parentThatIsA(StageMorph),&#xD;    context = stage.penTrails().getContext(&apos;2d&apos;),&#xD;    rotation = radians(this.direction() - 90),&#xD;    trans = new Point(&#xD;      this.center().x - stage.left(),&#xD;      this.center().y - stage.top()&#xD;    ),&#xD;    isWarped = this.Warped,&#xD;    len,&#xD;    pos;&#xD;&#xD;if (isWarped) {endWarp(); }&#xD;context.save();&#xD;context.font = size + &apos;px monospace&apos;;&#xD;context.textAlign = &apos;left&apos;;&#xD;context.textBaseline = &apos;alphabetic&apos;;&#xD;context.fillStyle = this.color.toString();&#xD;len = context.measureText(text).width;&#xD;trans = trans.multiplyBy(1 / stage.scale);&#xD;context.translate(trans.x, trans.y);&#xD;context.rotate(rotation);&#xD;context.fillText(text, 0, 0);&#xD;context.translate(-trans.x, -trans.y);&#xD;context.restore();&#xD;pos = new Point(&#xD;  len * Math.sin(radians(this.direction())),&#xD;  len * Math.cos(radians(this.direction())));&#xD;pos = pos.add(new Point(this.xPosition(), this.yPosition()));&#xD;this.gotoXY(pos.x, pos.y, false);&#xD;this.changed();&#xD;if (isWarped) {this.startWarp(); }&#xD;stage.changed();</l></block><list><block var=\"text\"/><block var=\"size\"/></list></block></script></block-definition><block-definition s=\"map %&apos;function&apos; over %&apos;lists&apos;\" type=\"reporter\" category=\"lists\"><header></header><code></code><inputs><input type=\"%repRing\"></input><input type=\"%mult%l\"></input></inputs><script><block s=\"doWarp\"><script><block s=\"doDeclareVariables\"><list><l>mapone</l><l>mapmany<