ted,\n                actual;\n\n            expected = [3, 0, 22, 33, 0];\n\n            if (output instanceof List) {\n                actual = _.map(output.asArray(), Number);\n            } else {\n                actual = output;\n            }\n            if (!_.isEqual(actual, expected)) {\n                tip_3_3.suggestion = 'The output should be ' + expected + ';';\n                tip_3_3.suggestion += ' but was ' + actual + '.';\n                return false;\n            }\n            return true;\n        },\n        4 * 1000, // 4 second time out.\n        true, // is isolated\n        1 // points\n    );\n\n\n\n\n\n    var blockName = \"Subset Sum Solution %\"\n    var chunk_4 = fb.newChunk('Complete the \"' + blockName + '\" block.');\n\n    var blockExists_4 = function () {\n        return spriteContainsBlock(blockName);\n    }\n\n    var tip_4_1 = chunk_4.newTip('Make sure you name your block exactly \"' + blockName + '\" and place it in the scripting area.',\n        'The \"' + blockName + '\" block exists.');\n\n    tip_4_1.newAssertTest(\n        blockExists_4,\n        'Testing if the \"' + blockName + '\" block is in the scripting area.',\n        'The \"' + blockName + '\" block is in the scripting area.',\n        'Make sure you name your block exactly \"' + blockName + '\" and place it in the scripting area.',\n        1\n    );\n\n\n    var tip_4_2 = chunk_4.newTip(\n        'Your block should return the correct values for given inputs.',\n        'Great job! Your block reports the correct value for given inputs.'\n    );\n\n    var input_4_2 = [[-2, -3, 15, 14, 7, -10]];\n    tip_4_2.newIOTest('r',  // testClass\n        blockName,          // blockSpec\n        input_4_2,        // input\n        function (output) {\n            // Output should be a list of 2D lists.\n            var expected,\n                actual;\n\n            expected = [-2, -3, 15, -10];\n\n            if (output instanceof List) {\n                var ar = output.asArray();\n\n                if (ar[0] instanceof List) {\n                    actual = _.map(ar[0].asArray(), Number);\n                } else {\n                    actual = _.map(ar, Number);\n                }\n            } else {\n                actual = output;\n            }\n            if (!_.isEqual(actual, expected)) {\n                tip_4_2.suggestion = 'The output should be ' + expected + ';';\n                tip_4_2.suggestion += ' but was ' + actual + '.';\n                return false;\n            }\n            return true;\n        },\n        4 * 1000, // 4 second time out.\n        true, // is isolated\n        1 // points\n    );\n\n    var tip_4_3 = chunk_4.newTip(\n        'Your block should return the correct values for given inputs.',\n        'Great job! Your block reports the correct value for given inputs.'\n    );\n\n    var input_4_3 = [[-2, -3, 16, 14, 7, -10]];\n    tip_4_3.newIOTest('r',  // testClass\n        blockName,          // blockSpec\n        input_4_3,        // input\n        function (output) {\n            // Output should be a list of 2D lists.\n            var expected,\n                actual;\n\n            expected = [];\n\n            if (output instanceof List) {\n                actual = _.map(output.asArray(), Number);\n            } else {\n                actual = output;\n            }\n            if (!_.isEqual(actual, expected)) {\n                tip_4_3.suggestion = 'The output should be ' + expected + ';';\n                tip_4_3.suggestion += ' but was ' + actual + '.';\n                return false;\n            }\n            return true;\n        },\n        4 * 1000, // 4 second time out.\n        true, // is isolated\n        1 // points\n    );\n\n    var tip_4_4 = chunk_4.newTip(\n        'Your block should return the correct values for given inputs.',\n        'Great job! Your block reports the correct value for given inputs.'\n    );\n\n    var input_4_4 = [[-2, -3, 0, 14, 7, -10]];\n    tip_4_4.newIOTest('r',  // testClass\n        blockName,          // blockSpec\n        input_4_4,        // input\n        function (output) {\n            // Output should be a list of 2D lists.\n            var expected,\n                actual;\n\n            expected = [0];\n\n            if (output instanceof List) {\n                actual = _.map(output.asArray(), Number);\n            } else {\n                actual = output;\n            }\n            if (_.isEqual(actual, [\"0\"])) {\n                return true;\n            } else if (!_.isEqual(actual, expected)) {\n                tip_4_4.suggestion = 'The output should be ' + expected + ';';\n                tip_4_4.suggestion += ' but was ' + actual + '.';\n                return false;\n            }\n            return true;\n        },\n        4 * 1000, // 4 second time out.\n        true, // is isolated\n        1 // points\n    );\n\n    return fb;\n}", starter_file: "<project name=\"BJC.3x HW Subset Sum Starter File\" app=\"Snap! 4.0, http://snap.berkeley.edu\" version=\"1\"><notes>The BJC.3x Subset Sum Starter File&#xD;Written by Dan Garcia &lt;ddgarcia@cs.berkeley.edu&gt;&#xD;CC-BY-NC-SA-4.0</notes><thumbnail>data:image/png;base64,</thumbnail><stage name=\"Stage\" width=\"480\" height=\"360\" costume=\"1\" tempo=\"60\" threadsafe=\"false\" lines=\"round\" codify=\"false\" inheritance=\"false\" scheduled=\"false\" id=\"1\"><pentrails>data:image/png;base64,</pentrails><costumes><list id=\"2\"><item><costume name=\"Berkeley Mural with BJC\" center-x=\"240\" center-y=\"180\" image=\"data:image/png;base64,\" id=\"3\"/></item></list></costumes><sounds><list id=\"4\"></list></sounds><variables></variables><blocks></blocks><scripts></scripts><sprites><sprite name=\"Subset Sum Solver\" idx=\"1\" x=\"-144.91171477079456\" y=\"-1.8624787775888763\" heading=\"90\" scale=\"0.6\" rotation=\"1\" draggable=\"true\" costume=\"1\" color=\"67.32000000000002,153,45.900000000000006\" pen=\"tip\" id=\"9\"><costumes><list id=\"10\"><item><costume name=\"Alonzo3D no shadow high compression\" center-x=\"240\" center-y=\"180\" image=\"data:image/png;base64,\" id=\"11\"/></item></list></costumes><sounds><list id=\"12\"></list></sounds><variables></variables><blocks></blocks><scripts><script x=\"15\" y=\"15\"><block s=\"receiveGo\"></block><block s=\"doDeclareVariables\"><list><l>solution</l></list></block><block s=\"doAsk\"><l>Let&apos;s solve a subset sum. Enter a set of integers separated by spaces.</l></block><block s=\"doForever\"><script><block s=\"doSetVar\"><l>solution</l><custom-block s=\"Subset Sum Solution %l\"><custom-block s=\"sentence $arrowRight list %txt\"><block s=\"getLastAnswer\"></block></custom-block></custom-block></block><block s=\"doIfElse\"><custom-block s=\"empty? %l\"><block var=\"solution\"/></custom-block><script><block s=\"doAsk\"><l>Sorry, there&apos;s no way to add together a subset of those numbers to get 0. Let&apos;s try again ... enter a set of integers separated by spaces.</l></block></script><script><block s=\"doAsk\"><custom-block s=\"join words %mult%txt\"><list><l>The subset of that which add to zero is: {</l><custom-block s=\"list $arrowRight sentence %l\"><block var=\"solution\"/></custom-block><l>}. Let&apos;s try it again!</l></list></custom-block></block></script></block></script></block></script><comment x=\"15\" y=\"325.5\" w=\"445.5\" collapsed=\"false\">Subset Sum Solution BJC.3x homework.  Complete the blocks below so that the code above works.</comment><script x=\"15\" y=\"372\"><custom-block s=\"2 ^ %n\"><l></l><comment w=\"341.5000000000001\" collapsed=\"false\">2a) Input is a non-negative integer, the output is 2 to the power of the input.&#xD;E.g., 2^(4) → 16</comment></custom-block></script><script x=\"15\" y=\"433.5\"><custom-block s=\"%n $arrowRight binary list padded to %n digits\"><l></l><l></l><comment w=\"307.5\" collapsed=\"false\">2b) Convert an integer to its binary representation, zero-pad it to have D digits, and store each bit as a different element in a list. The &quot;endianness&quot; doesn&apos;t matter -- that is, the ones bit in the binary representation can be in list element 1 or list element D.&#xD;REQUIRES: D be at least as big as the number of digits in the binary representation of the number&#xD;E.g., (13)-&gt;binary-list-padded-to(5)digits → [1,0,1,1,0] or [0,1,1,0,1]&#xD;E.g., (13)-&gt;binary-list-padded-to(4)digits → [1,0,1,1] or [1,1,0,1]</comment></custom-block></script><script x=\"15\" y=\"566.9999999999999\"><custom-block s=\"Binary List Mask %l with %l\"><l/><l/><comment w=\"342.49999999999994\" collapsed=\"false\">2c) Binary List Mask is just like a number mask but with a binary list and a regular number list. A &quot;mask&quot; is a way to zero-out the numbers where there&apos;s a 0, and keep the numbers where there&apos;s a 1. The term used in computer architecture and graphic design (which often allows the mask to have numbers other than 0 and 1, for semi-transparent pixels).&#xD;REQUIRES: the two lists be the same length, the first contain only 1s and 0s, and the second contain only numbers.&#xD;E.g., Binary-List-Mask([1,0,1])with([3,4,5]) → [3,0,5]</comment></custom-block></script><script x=\"15\" y=\"700.4999999999999\"><custom-block s=\"Subset Sum Solution %l\"><l/><comment w=\"362.4999999999999\" collapsed=\"false\">2d) Solve the subset sum problem. That is, given a list of numbers, return a subset of those numbers that add to zero. (if none, return an empty list. If there is more than one subset, return any of them.)&#xD;E.g., Subset-Sum-Solution([-2,-3,15,14,7,-10]) → [-2,-3,15,-10]&#xD;E.g., Subset-Sum-Solution([-2,-3,16,14,7,-10]) → []&#xD;E.g., Subset-Sum-Solution([-2,-3,0,14,7,-10]) → [0]&#xD;</comment></custom-block></script></scripts></sprite></sprites></stage><hidden></hidden><headers></headers><code></code><blocks><block-definition s=\"label %&apos;text&apos; of size %&apos;size&apos;\" type=\"command\" category=\"pen\"><comment x=\"0\" y=\"0\" w=\"90\" collapsed=\"false\">LABEL will stamp text on the stage at the given font size. The direction of the text is the direction the sprite is facing, and color will match the pen color.</comment><header></header><code></code><inputs><input type=\"%txt\">Hello!</input><input type=\"%n\">12</input></inputs><script><block s=\"doRun\"><block s=\"reportJSFunction\"><list><l>text</l><l>size</l></list><l>var stage = this.parentThatIsA(StageMorph),&#xD;    context = stage.penTrails().getContext(&apos;2d&apos;),&#xD;    rotation = radians(this.direction() - 90),&#xD;    trans = new Point(&#xD;      this.center().x - stage.left(),&#xD;      this.center().y - stage.top()&#xD;    ),&#xD;    isWarped = this.Warped,&#xD;    len,&#xD;    pos;&#xD;&#xD;if (isWarped) {endWarp(); }&#xD;context.save();&#xD;context.font = size + &apos;px monospace&apos;;&#xD;context.textAlign = &apos;left&apos;;&#xD;context.textBaseline = &apos;alphabetic&apos;;&#xD;context.fillStyle = this.color.toString();&#xD;len = context.measureText(text).width;&#xD;trans = trans.multiplyBy(1 / stage.scale);&#xD;context.translate(trans.x, trans.y);&#xD;context.rotate(rotation);&#xD;context.fillText(text, 0, 0);&#xD;context.translate(-trans.x, -trans.y);&#xD;context.restore();&#xD;pos = new Point(&#xD;  len * Math.sin(radians(this.direction())),&#xD;  len * Math.cos(radians(this.direction())));&#xD;pos = pos.add(new Point(this.xPosition(), this.yPosition()));&#xD;this.gotoXY(pos.x, pos.y, false);&#xD;this.changed();&#xD;if (isWarped) {this.startWarp(); }&#xD;stage.changed();</l></block><list><block var=\"text\"/><block var=\"size\"/></list></block></script></block-definition><block-definition s=\"map %&apos;function&apos; over %&apos;lists&apos;\" type=\"reporter\" category=\"lists\"><header></header><code></code><inputs><input type=\"%repRing\"></input><input type=\"%mult%l\"></input></inputs><script><block s=\"doWarp\"><script><block s=\"doDeclareVariables\"><list><l>mapone</l><l>mapmany<